import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom"; // Import Router
import LandingPage from "./LandingPage"; // Landing Page Component
import NoteItCanvas from "./NoteItCanvas"; // Your main app component

function App() {
  return (
    <Router> {/* Wrap with Router for navigation */}
      <Routes>
        <Route path="/" element={<LandingPage />} /> {/* Landing page at root */}
        <Route path="/app" element={<NoteItCanvas />} /> {/* Main app at '/app' */}
      </Routes>
    </Router>
  );
}

export default App;
